import React from 'react'
import "./Message.css"
import { Alert } from '@material-ui/core'

const Message = ({ severity, children }) => {
    return (
        <Alert severity={severity}>
            {children}
        </Alert>
    )
}

Message.defaultProps = {
    variant: "info"
}

export default Message
